import UIKit

class ViewController: UIViewController {

    @IBAction func btnGetContent(_ sender: Any) {
        content = webView.stringByEvaluatingJavaScript(from: "getContent();")
    }
    @IBOutlet weak var webView: UIWebView!
    @IBOutlet weak var tfUrl: UITextField!
    @IBOutlet weak var activityIndicator: UIActivityIndicatorView!
    
    let ckURL = "http://13.92.130.153/test/editor.html"
    var content: String?
    override func viewDidLoad() {
        super.viewDidLoad()
        self.automaticallyAdjustsScrollViewInsets = false
        tfUrl.text = ckURL
        webView.delegate = self
        
        activityIndicator.startAnimating()
        if let url = URL(string: ckURL) {
            let request = URLRequest(url: url)
            webView.loadRequest(request)
            
        } else {
            print("Invalid URL")
            activityIndicator.stopAnimating()
        }


    }

    override func didReceiveMemoryWarning() {
        super.didReceiveMemoryWarning()
        // Dispose of any resources that can be recreated.
    }
}

extension ViewController: UIWebViewDelegate {
    
    func webView(_ webView: UIWebView, shouldStartLoadWith request: URLRequest, navigationType: UIWebViewNavigationType) -> Bool {
        print("Scheme: ", request.url?.scheme ?? "no scheme")
        if let scheme = request.url?.scheme {
            if scheme == "hops"{
                print("url: ", request.url ?? "No url")
            }
        }
        return true
    }
    
    func webViewDidStartLoad(_ webView: UIWebView) {
        
    }
    
    func webViewDidFinishLoad(_ webView: UIWebView) {
        activityIndicator.stopAnimating()
        webView.stringByEvaluatingJavaScript(from: "setContent('\("Hello,How R you?")')")
        
        
        print("webViewDidFinishLoad: ", webView.request?.url?.scheme ?? "??")
    }
    
    func webView(_ webView: UIWebView, didFailLoadWithError error: Error) {
        
    }
}

